    false,nt"url": null,nt"notes": "Annual (water year, October-September)
    runoff (mm) of the Burdekin River, Queensland, Australia was reconstructed from
    intensity of fluorescence measured in two coral cores from Havannah and Pandora
    Reefs which lie in the Burdekin River plume. The following three data sets are provided:
    1) Reconstruction of annual Burdekin River runoff (mm), 1644-1980. 2) Havannah Reef
    standardized (with respect to long-term mean sd) fluorescence index, 1644-1986.
    3) Pandora Reef standardized (with respect to long-term mean sd) fluorescence index,
